import React from 'react'
import {Link} from 'react-router-dom'
// import './Landing.css'
// import logo from '../images/j1.svg'
import PropTypes from 'prop-types'

const Landing = props => {
    return (
        <div className="container w-full h-screen" >
            <h1 className="text-center text-2xl"> The Open Source Sneaker API</h1>
            <p className="inline text-center text-xl align-left"> We're building an ecosystem for sneakerheads, sneaker enthusiast and casual sneaker wearers to find a sorts of sneakers.</p>
            <p> It is easy to contribute.</p>

            <div className="flex flex-row inline text-center">
                <Link class="bg-white hover:bg-gray-100 text-gray-800 font-semibold py-2 px-4 border border-gray-400 rounded shadow" to="/developer">
                View Docs
                </Link>
                <Link class="bg-white hover:bg-gray-100 text-gray-800 font-semibold py-2 px-4 border border-gray-400 rounded shadow" to="/">
                View Product
                </Link>
            </div>

        </div>
    )
}

Landing.propTypes = {

}

export default Landing
